import { Table, Tbody, Tr, Td} from "@chakra-ui/react";

const TableElement = () => {
  return(
    <Table variant="striped" colorScheme="teal" borderWidth="1px" borderColor="">
      <Tbody>
        <Tr>
            <Td color="#FFF">AAAA</Td>
            <Td color="#FFF">AAAA</Td>
            <Td color="#FFF">AAAA</Td>
        </Tr>
      </Tbody>
    </Table>
  );
}

export default TableElement;
